class Product{constructor(e){this.Name=e.Name,this.Vegan=1===e.Is_Vegan,this.Image=e.Image,this.Brand=new Brand(e)}static search(e){return new Promise(t=>Ajax.Post("search",{body:{query:e},success:{ok:e=>t(e.body.map(e=>new Product(e)))}}))}static reportMissing(){Dialog.ShowTextBox(Localizer.MISSING_PRODUCT_TITLE,Localizer.MISSING_PRODUCT_DESC,{DefaultValue:txtSearch.value}).then(e=>autoReportMissing(e))}reportIncorrect(){Dialog.ShowTextBox(Localizer.INCORRECT_INFORMATION_TITLE,Localizer.INCORRECT_INFORMATION_DESC,{Rows:12,Multiline:!0}).then(e=>{report("INCORRECT-INFO","Incorrect Product Information",`Using the built in feedback feature, a user has reported that **${this.Name}** by **${this.Brand.Name}** has incorrect information, stating:\n>${e}`)})}}